As described further in our Privacy Policy, in the preceding twelve (12) months, we or our Third-Party Providers may have collected the below categories of Personal Information for business or commercial purposes: Geolocation information (general location, and, if you provide permission, precise GPS location);
We may use your Personal Information, Usage Information, Tracking Information, or Location Information we collect or you provide to us, in order to: We may use Location Information to customize products or information specific to your region.
We use Location Information solely as necessary to analyze and improve our Services.
